  true,\n\t\"url\": null,\n\t\"notes\": \"<p>Consistent with the ACF Strategic Initiative
  to u201cupgrade the capacity of the Administration for Children and Families to
  make a difference for families and communities by promoting resilience and facilitating
  recovery in children, youth, and communities impacted by disasters by developing
  and implementing an ACF Emergency Response Readiness Force (ERRF):u201d</p>n<p>The
  Office of Human Services Emergency Preparedness and Response (OHSEPR), in collaboration
  with the Regional Administrators and Regional Emergency Management Specialists (REMS)
  is recruiting ACF-wide (central and regional) to build a trained cadre of ACF volunteers
  ready, willing and able to deploy to disasters to provide or coordinate human services
  to assist with response and recovery of disaster survivors. Employees authorized
  to deploy, serve outside the confines of the Consolidated Collective Bargaining
  Agreement (CCBA) because of the emergency situation.</p>n\",\n\t\"license_title\":
